CPython has the infamous GIL (Global Interpreter Lock), which prevents developers from getting true parallelism when running pure Python code. While PyO3 needs to hold the GIL by default when called from Python, in order to allow manipulation of Python objects, you can release the GIL when executing Rust-only code to achieve true parallelism. The Python::allow_threads method temporarily releases the GIL, thus allowing other Python threads to run. impl Python { pub fn allow_threads<T, F>(self, f: F) -> T where F: Send + FnOnce() -> T {}
} Let's take a look at our word-count example, where we have a wc_parallel function that utilizes the rayon crate to count words in parallel. fn wc_parallel(lines: &str, search: &str) -> i32 { lines.par_lines() .map(|line| wc_line(line, search)) .sum()
